import React, { useEffect, useState } from "react";
import Navbarcomponent from "../navbar";
import axios from "axios";
import { useParams } from "react-router";

const BookingStatus = ({ cart }) => {
  const [customerBook, setCustomerBook] = useState([]);
const {id}=useParams();
  useEffect(() => {
    axios
      .get(`http://localhost:8182/customerBook/customerid/${id}`)
      .then((response) => {
        console.log("API response:", response.data);
        setCustomerBook(response.data);
      })
      .catch((error) =>
        console.error("Error fetching customer books:", error)
      );
  }, []);

  return (
    <div>
      <Navbarcomponent />
      <h1>Booking Status</h1>
      <div>
      {customerBook.filter((booking) => booking.isInCart).map((booking) => (
  <div key={booking.id}>
    <p>Issue Date: {booking.issueDate}</p>
    <p>Return Date: {booking.returnDate}</p>
    <p>Fine: {booking.amount}</p>
    <hr />
  </div>
))}
      </div>
    </div>
  );
}

export default BookingStatus;
